import  React from'react';


import './App.css';


function App() {

  /* const calculations = () => {

    const [values,setValues]=useState({first:"",second:"",multiply:""})
    //const [first,setFirst]=useState('')
    //const [second,setSecond]=useState('')
    //const [multiply,setMultiply]=useState('')

    //setValues(newValues)
    calcmultiply(newValues)
    //calcfirst(newValues)
    //calcSecond(newValues)


    } */
    const calcmultiply = (newValues) => {
    const first = document.querySelector('#ratePerGram').value;
    const second = document.querySelector('#weight').value;

    alert(first);

     // const { first,second} = newValues;
    const newMultiply = parseInt(first)*parseInt(second);
    document.querySelector('.total').value=parseInt(newMultiply);
    //setMultiply(newMultiply)
    }

    const styles = {
      fontFamily: "sans-serif",
      textAlign: "center"
    };
    const colstyle = {
      width: "30%"
    };
    const tableStyle = {
      width: "100%"
    };
    const Prints = () => (
      <div>
        <h3>Time & Materials Statement of Work (SOW)</h3>
        <h4>General Information</h4>
        <table id="tab_customers" class="table table-striped" style={tableStyle}>
          <colgroup>
            <col span="1" style={colstyle} />
            <col span="1" style={colstyle} />
          </colgroup>
          <thead>
            <tr class="warning">
              <th>SOW Creation Date</th>
              <th>SOW Start Date</th>
              <th>Project</th>
              <th>Last Updated</th>
              <th>SOW End Date</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>Dec 13, 2017</td>
              <td>Jan 1, 2018</td>
              <td>NM Connect - NMETNMCM</td>
              <td>Dec 13, 2017</td>
              <td>Dec 31, 2018</td>
            </tr>
          </tbody>
        </table>
        <p>
          This is a Time and Materials Statement of Work between Northwestern Mutual
          Life Insurance Company and Infosys with all general terms and conditions
          as described in the current Master Agreement and its related documents
        </p>
      </div>
    );


    const generatePDF = () => {
     // const doc = new jsPDF();

      const string = renderToString(<Prints />);
      const pdf = new jsPDF("p", "mm", "a4");

     // renderToString(<Prints />);
     // doc.fromHTML(ReactDOMServer.renderToString(<Prints />));
    //  doc.save("myDocument.pdf");

      pdf.fromHTML(string);
      pdf.save("mydocument.pdf");
    } 


  return(


    <div className="form">

      <form>
      <fieldset>
        <h3> Billing Details:</h3>
        <div className="formInputs">
           <TextField id="standard-basic" label="Name" variant="standard" />
          </div>
          <div className="formInputs">
          <TextField id="standard-basic" label="Phone No." variant="standard" />
         </div>
         <div className="formInputs">
         <TextField id="standard-basic" label="Email Id" variant="standard" />
         </div>
         <div className="formInputs">             
         <TextField id="standard-basic" label="Id Proof No" variant="standard" />
         </div>
         <div className="formInputs">
         <TextField id="standard-basic" label="Address" variant="standard" />
         </div>
         <div className="formInputs">
         <TextField id="standard-basic" label="State" variant="standard" />
         </div>
         <div className="formInputs">

         <TextField id="standard-basic" label="State" variant="standard" />
          </div>
          <div className="formInputs">

          <TextField id="standard-basic" label="Date" variant="standard" />

          </div>

          <div className="formInputs">


          <TextField id="standard-basic" label="Days" variant="standard" />

          </div>


          <div className="formInputs">
          <TextField id="standard-basic ratePerGram" label="Rate Per Gram" variant="standard"  onChange={(e)=> calcmultiply(e.target.value)} placeholder="Rate per gram" className='ratePerGram'/>

         </div>

         <div className="formInputs">
         <TextField id="standard-basic" label="Weight" variant="standard"  onChange={(e)=> calcmultiply(e.target.value)} placeholder="weight" className='weight'/>
           {/* <input type ="text" onChange={(e)=> setOperation(e.target.value)} placeholder="operation"/> */}




         </div>








         <div className="formInputs">

         <TextField id="standard-basic" label="Amount" variant="standard" className="total"/>

         </div>


       </fieldset>



       <button variant="contained" onClick={generatePDF}>Submit</button>


      </form>
    </div>
  )
  }
export default App;
